import React from 'react';

interface Transaction {
  id: string;
  amount: number;
  account: string;
  type: 'deposit' | 'withdrawal';
}

interface TransactionListProps {
  transactions: Transaction[];
  currentBalance: number;
}

const TransactionList: React.FC<TransactionListProps> = ({ transactions, currentBalance }) => {
  return (
    <div>
      <h2>Transaction history</h2>
      <div>
        <strong>Current account balance is ${currentBalance}</strong>
      </div>
      <ul>
        {transactions.map((transaction) => (
          <li key={transaction.id}>
            Transferred ${transaction.amount} {transaction.type === 'withdrawal' ? 'from' : 'to'} account {transaction.account}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TransactionList;



<div className="Home container mt-5">
<div className='row'>
    <div className='col'>      <TransactionForm onSubmit={addTransaction} />
</div>
    <div className='col'>      <TransactionList transactions={transactions} currentBalance={currentBalance} />
</div>
</div>
</div>
